declarations.default:
{
  stories: ['../../src/**/*.stories.@(js|jsx|ts|tsx)'],
  addons: ['@storybook/addon-links', '@storybook/addon-essentials'],
  framework: {
    name: '@storybook/web-components-vite',
    options: {},
  },
  core: {
    disableTelemetry: true, // ðŸ‘ˆ Disables telemetry
  },
  docs: {
    autodocs: 'tag',
  },
  staticDirs: ['./public'],
}

{
  parameters: {
    actions: { argTypesRegex: '^on[A-Z].*' },
    controls: {
      controls: { expanded: true },
      matchers: {
        color: /(background|color)$/i,
        date: /Date$/,
      },
    },
  },
  decorators: [withThemeProvider],
  globalTypes: {
    theme: {
      description: 'Global theme for components',
      defaultValue: themes[0].name,
      toolbar: {
        // The label to show for this toolbar item
        title: 'Theme',
        icon: 'globe',
        // Array of plain string values or MenuItem shape (see below)
        items: themes.map((theme) => theme.name),
        // Change title based on selected value
        dynamicTitle: true,
      },
    },
  },
}

{
  type: 'addMany',
  base,
  templateFiles: `${join(`${base}`, '**')}`,
  destination: `${join(`${folders.components}`, `{{${componentName}}}`)}`,
  data: {
    componentName,
    prefix: componentNamePrefix,
    separator: componentNameSeparator,
  },
  globOptions: {
    // allow hidden files to be copied as well:
    dot: false,
  },
}

{
  type: 'modify',
  path: `${join(`${folders.src}`, 'index.ts')}`,
  pattern: /(};)/g,
  data: {
    componentName,
    prefix: componentNamePrefix,
  },
  template:
    `  {{sentenceCase prefix}}{{sentenceCase ${componentName}}},\n$1`,
}

{
  type: 'modify',
  path: `${join(`${folders.src}`, 'index.ts')}`,
  pattern: /(\nexport)/g,
  data: {
    componentName,
    prefix: componentNamePrefix,
  },
  template:
    `import { {{sentenceCase prefix}}{{sentenceCase ${componentName}}} } from './components/{{${componentName}}}';\n$1`,
}

{
  ACCESSIBILITY,
  VISUAL_REGRESSION,
}

{
  src: `${join(root, 'src')}`,
  components: `${join(root, 'src', 'components')}`,
  templates: `${join(plop, 'templates')}`,
}

[
